import React from 'react';

import Timeslot from '../Timeslot/Timeslot.jsx'

import './TimeTable.scss';

export default function TimeTable(props) {

    timeslots = []

    for (let i = 1; i <= 24; ++i) {
        timeslots.append(
            <Timeslot time = {i} />
        )
    }


    return (
        <>
            {timeslots}
        </>
    );
}
